 the power of animating the trees, mountains, and rivers it surrounds. Emptiness can mean having no fixed preconceptions, preferences, intentions, or agenda. Since \"The Sage has no heart of his own; He uses the heart of the people as his heart.\" (chap. 49, tr. Waley). From a ruler\'s point of view, it is a laissez-faire approach:\r\n\r\n    So a wise leader may say:\r\n    \"I practice inaction, and the people look after themselves.\"\r\n    But from the Sage it is so hard at any price to get a single word\r\n    That when his task is accomplished, his work done,\r\n    Throughout the country every one says: \"It happened of its own accord\". (chap. 17, tr. Waley) ','Philosophical vacuity is a common theme among Asian philosophical traditions including Taoism (especially Wu wei \"effortless action\"), Buddhism, and some aspects of Confucianism. One could interpret the Tao Te Ching as a suite of variations on the \"Powers of Nothingness\". This predates the Buddhist Shunyata philosophy of \"form is emptiness, emptiness is form\" by half a millennium.\r\n\r\nLooking at a traditional Chinese Landscape, one can understand how emptiness (the unpainted) has the power of animating the trees, mountains, and rivers it surrounds. Emptiness can mean having no fixed preconceptions, preferences, intentions, or agenda. Since \"The Sage has no heart of his own; He uses the heart of the people as his heart.\" (chap. 49, tr. Waley). From a ruler\'s point of view, it is a laissez-faire approach:\r\n\r\n    So a wise leader may say:\r\n    \"I practice inaction, and the people look after themselves.\"\r\n    But from the Sage it is so hard at any price to get a single word\r\n    That when his task is accomplished, his work done,\r\n    Throughout the country every one says: \"It happened of its own accord\". (chap. 17, tr. Waley) ',252,NULL,NULL,'','1260','','2520','','252','','','51.5161473','-0.132133500000009',1000,'W1D 2DZ','Londres','GB','45 Oxford St',NULL,NULL,NULL,NULL,'on',NULL,NULL,'2015-12-30 07:50:26','2015-12-30 07:52:53',NULL),(46,1,'','Annonce #55001','Dukkha (Pāli; Sanskrit: duḥkha; Tibetan: སྡུག་བསྔལ་ sdug bsngal, pr. \"duk-ngel\") is a Buddhist term commonly translated as \"suffering\", \"anxiety\", \"stress\", or \"unsatisfactoriness\".[a] The principle of dukkha is one of the most important concepts in the Buddhist tradition. The Buddha is reputed to have said: \"I have taught one thing and one thing only, dukkha and the cessation of dukkha.\" The classic formulation of these teachings on dukkha is the doctrine of the Four Noble Truths, in which the Truth of Dukkha (Pali: dukkha saccã; Sanskrit: duḥkha-satya) is identified as the first.\r\n\r\nDukkha is commonly explained according to three categories:\r\n\r\n    The obvious physical and mental suffering associated with birth, growing old, illness and dying.\r\n    The anxiety or stress of trying to hold on to things that are constantly changing.\r\n    A basic unsatisfactoriness pervading all forms of existence, because all forms of life are changing, impermanent and without any inner core or substance.\r\n','Dukkha (Pāli; Sanskrit: duḥkha; Tibetan: སྡུག་བསྔལ་ sdug bsngal, pr. \"duk-ngel\") is a Buddhist term commonly translated as \"suffering\", \"anxiety\", \"stress\", or \"unsatisfactoriness\".[a] The principle of dukkha is one of the most important concepts in the Buddhist tradition. The Buddha is reputed to have said: \"I have taught one thing and one thing only, dukkha and the cessation of dukkha.\" The classic formulation of these teachings on dukkha is the doctrine of the Four Noble Truths, in which the Truth of Dukkha (Pali: dukkha saccã; Sanskrit: duḥkha-satya) is identified as the first.\r\n\r\nDukkha is commonly explained according to three categories:\r\n\r\n    The obvious physical and mental suffering associated with birth, growing old, illness and dying.\r\n    The anxiety or stress of trying to hold on to things that are constantly changing.\r\n    A basic unsatisfactoriness pervading all forms of existence, because all forms of life are changing, impermanent and without any inner core or substance.\r\n','Dukkha (Pāli; Sanskrit: duḥkha; Tibetan: སྡུག་བསྔལ་ sdug bsngal, pr. \"duk-ngel\") is a Buddhist term commonly translated as \"suffering\", \"anxiety\", \"stress\", or \"unsatisfactoriness\".[a] The principle of dukkha is one of the most important concepts in the Buddhist tradition. The Buddha is reputed to have said: \"I have taught one thing and one thing only, dukkha and the cessation of dukkha.\" The classic formulation of these teachings on dukkha is the doctrine of the Four Noble Truths, in which the Truth of Dukkha (Pali: dukkha saccã; Sanskrit: duḥkha-satya) is identified as the first.\r\n\r\nDukkha is commonly explained according to three categories:\r\n\r\n    The obvious physical and mental suffering associated with birth, growing old, illness and dying.\r\n    The anxiety or stress of trying to hold on to things that are constantly changing.\r\n    A basic unsatisfactoriness pervading all forms of existence, because all forms of life are changing, impermanent and without any inner core or substance.\r\n',857,NULL,NULL,'','4285','','8570',NULL,NULL,'','','51.51740840000001','-0.17215839999994387',1000,'W2 1NT','Londres','GB','85 Praed St',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2015-12-30 09:36:11','2015-12-30 09:36:57',NULL),(47,1,'','Professeur de Yoga - Saint Mandé et Paris - Cours personnalisé et en salle','Dukkha is commonly explained according to three categories:\r\n\r\n    The obvious physical and mental suffering associated with birth, growing old, illness and dying.\r\n    The anxiety or stress of trying to hold on to things that are constantly changing.\r\n    A basic unsatisfactoriness pervading all forms of existence, because all forms of life are changing, impermanent and without any inner core or substance.\r\n\r\nThe Buddhist tradition emphasizes the importance of developing insight into the nature of dukkha, the conditions that cause it, and how it can be overcome. This process is formulated in the teachings on the Four Noble Truths.','Dukkha is commonly explained according to three categories:\r\n\r\n    The obvious physical and mental suffering associated with birth, growing old, illness and dying.\r\n    The anxiety or stress of trying to hold on to things that are constantly changing.\r\n    A basic unsatisfactoriness pervading all forms of existence, because all forms of life are changing, impermanent and without any inner core or substance.\r\n\r\nThe Buddhist tradition emphasizes the importance of developing insight into the nature of dukkha, the conditions that cause it, and how it can be overcome. This process is formulated in the teachings on the Four Noble Truths.','Dukkha is commonly explained according to three categories:\r\n\r\n    The obvious physical and mental suffering associated with birth, growing old, illness and dying.\r\n    The anxiety or stress of trying to hold on to things that are constantly changing.\r\n    A basic unsatisfactoriness pervading all forms of existence, because all forms of life are changing, impermanent and without any inner core or substance.\r\n\r\nThe Buddhist tradition emphasizes the importance of developing insight into the nature of dukkha, the conditions that cause it, and how it can be overcome. This process is formulated in the teachings on the Four Noble Truths.',187,NULL,NULL,'','935','','1870',NULL,NULL,'','','51.4901162','-0.17482270000004974',1000,'SW3 6HR','Londres','GB','84 Fulham Rd',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2015-12-31 12:04:06','2015-12-31 12:05:37',NULL),(48,1,'','Cours et soutien en Français et Lettres modernes par professeur agrégé de Lettres','Professeur agrégé de Lettres, doctorant en Littérature, donne cours et /ou soutien en Français et Lettres Modernes, tous niveaux.\r\nJ\'ai une expérience dans la préparation au baccalauréat en cours particulier.\r\nLittérature : Mon enseignement est fait d\'apports culturels, de conseils pour les techniques de rédaction ou de commentaire, et de discussion avec l\'élève : étude approfondie des textes, mise en contexte historique, construction d\'un plan avec l\'élève.\r\nJ\'ai également donné des cours de méthodologie du commentaire composé et de la dissertation pour des étudiants en première année d\'études supérieures.\r\nLangue française : j\'ai enseigné durant deux ans le français dans des universités américaines. Titulaire du CAPES, je connais les programmes de grammaire à tous les niveaux du secondaire.\r\nPoints d\'enseignement privilégiés :\r\n--> Méthodologie du commentaire composé, de l\'explication linéaire et de la dissertation : élaborer une problématique, construire un plan, articuler ses idées et améliorer sa rédaction.\r\n--> Apprentissage et appropriation des différents angles d\'approches des oeuvres et des textes: historicité, intertextualité, linguistique et stylistique.\r\n--> Français Langue Etrangère, grammaire et orthographe françaises. ','Cours particuliers : depuis 2004, pour tout niveau du collège au études supérieures. J\'ai vu de gros progrès chez mes élèves, avec d\'excellentes réussites au bac et des reprises de confiance assez spectaculaires.\r\nCours à l\'université française : méthode du commentaire, thèmes littéraires.\r\nCours dans des universités américaines : Français Langue étrangère.\r\nCours en lycée : expérience d\'un an en classe de seconde générale.','1999-2002 Hypokhâgne et Khâgne (Lycée du Parc)\r\n2002-2003 Licence de Lettres à la Sorbonne\r\n2003-2004 Maîtrise de Lettres à la Sorbonne mention Très bien.\r\n2005-2006 Master 2 de Lettres à Paris 8 mention Très bien.\r\n2006-2007 Rédacteur pour entreprises (société Ubiqus).\r\n2007-2008 Préparation de l\'agrégation de Lettres Modernes (admissible)\r\n2008-2011 Doctorant en Littérature. Chargé de cours à l\'université.\r\n2011-2012 Enseignant de Français Langue Etrangère à l\'Université de Cornell, New-York, USA\r\n2012-2013 Enseignant de Français Langue Etrangère à l\'Université de Vanderbilt, Nashville Tennessee, USA\r\n2013-3014 Professeur en Lycée, région Rhône-Alpes.\r\n2015 - Admis à l\'agrégation de Lettres Modernes',500,NULL,NULL,'','2500','','5000',NULL,NULL,'','','48.891986','2.319287000000031',1000,'75017','Paris','FR','10 Rue Pouchet',NULL,NULL,'on',NULL,NULL,NULL,NULL,'2015-12-31 18:08:01','2015-12-31 18:10:46',NULL),(49,1,'cours-et-soutien-en-francais-et-lettres-modernes-par-professeur-agrege-de-maths','Cours et soutien en Français et Lettres modernes par professeur agrégé de Lettres','Bonjour,\r\nJe suis titulaire de l\'Education Nationale en Lettres Modernes et diplômée d\'un Master 2 en philosophie esthétique. En poste depuis de nombreuses années en collège et lycée, j\'enseigne, pour cette année scolaire, le français à des élèves de 2de générales et 1ère S et L. Depuis deux ans, j\'enseigne également la synthèse littéraire de documents en école de commerce : j\'entraîne mes étudiants de 1ère et 2ème années aux concours Passerelle et Tremplin. Je suis intervenante dans une école de commerce réputée (8ème au classement général selon le magazine Challenges).\r\n\r\nPar ailleurs, ma pédagogie, mon excellente connaissance du programme et des notions s\'y rapportant ainsi que ma maîtrise de la méthodologie répondront à toutes vos attentes.\r\n\r\nEnfin, j\'ai eu la chance d\'avoir de nombreuses classes de différents niveaux au cours de mes expériences éducatives : en effet, par mon expérience de professeur à domicile mais également grâce aux élèves que je suivais les années précédentes aussi bien au collège qu\'au lycée et en école de commerce, il m\'a été donné d\'éprouver un large panel éducatif.\r\nTous mes cours sont assortis de documents et rigoureusement préparés. Je suis à la disposition de mes élèves par mail, webcam et téléphone. Je suis aussi là pour répondre à toutes questions annexes à la scolarité. Entraînement en situation d\'examen ou de concours (Diplôme National du Brevet, oral et écrit de l\'EAF, concours Tremplin et Passerelle) afin de se préparer dans des conditions optimales.\r\nN\'hésitez pas à me demander mes références (Education Nationale, école de commerce et cours particuliers).\r\nEn préparation de mon site (prévu pour mi-janvier 2016) : tarifs avantageux et conditions professionnelles de travail dans un local dédié !','COURS EN INDIVIDUEL :\r\n-- 40 € pour les collégiens,\r\n-- 50 € pour les lycéens,\r\n-- 60 € pour le supérieur.\r\nLe prix de la première heure de cours sera majoré de 5 euros pour un déplacement jusqu\'à 10km, de 10 euros pour un déplacement de plus de 10km.\r\nSi 10 heures sont payées d\'avance, une remise de 5% est appliquée.\r\n\r\nCOURS EN PETITS GROUPES DE TRAVAIL (de 5 à 6 élèves au maximum) :\r\n-- 55 € pour 2 heures (niveau collège).\r\n--100 € pour 4 heures (niveau collège).\r\n-- 75 € pour 2 heures (niveau lycée).\r\n-- 140 € pour 4 heures (niveau lycée).\r\n-- 95 € pour 2 heures (niveau supérieur).\r\n-- 180 € pour 4 heures (niveau supérieur).\r\nLes cours se déroulent dans un local dédié.\r\nSi 10 heures sont payées d\'avance, une remise de 5% est appliquée.\r\n\r\nSTAGES DE 10 HEURES SUR 5 JOURS EN PETITS GROUPES DE TRAVAIL (de 5 à 6 élèves au maximum) :\r\n-- 250 € (niveau collège).\r\n-- 350 € (niveau lycée).\r\n-- 450 € (niveau supérieur).\r\nLes cours se déroulent dans un local dédié.\r\nSi les 10 heures sont payées d\'avance, une remise de 5% est appliquée.','Mon parcours en quelques dates :\r\n2015-2016 : collaboratrice des éditions Le livre scolaire pour la rédaction du manuel scolaire de 3ème.\r\n2014-2016 : En charge des classes de 2de générales et 1ère S et L. Professeur principal et Coordinatrice du français au lycée. Intervenante en école de commerce pour la préparation au concours Passerelle et Tremplin.\r\n2014 : obtention de l\'Agrégation interne de Lettres Modernes.\r\n2013-2014 : Coordinatrice du français au collège.\r\n2007-2013 : Enseignante en lettres modernes et professeur principal. Depuis 2009, correctrice et examinatrice pour le Diplôme National du Brevet et le Baccalauréat.\r\n2006-2007 : Préparation au Capes de Lettres Modernes.\r\n2001-2006 : Etudiante. DEA (actuel Master 2) de philosophie esthétique. Mention Très bien avec félicitations du jury.\r\n2000-2001 : année sabbatique à l\'étranger.\r\n1998-2000 : Hypokhâgne et khâgne a/l au lycée Condorcet (75009).\r\n1998 : Bac littéraire en horaires aménagés au lycée Racine (75008). Mention Bien.',200,'50','250','5','950','10','1800',NULL,NULL,'','','48.8642858','2.37901880000004',10000,'75011','Paris','FR','78 Avenue de la République',NULL,NULL,NULL,'on',NULL,NULL,NULL,'2016-01-02 18:40:13','2016-01-02 20:33:17',NULL),(50,1,'','Cours et soutien en Français et Lettres modernes par professeur agrégé de Lettres','','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2016-01-02 20:33:54','2016-01-02 20:33:59',NULL),(51,1,'','Cours et soutien en Français et Lettres modernes par professeur agrégé de Philosophie','Bonjour,\r\n\r\nEn 2013, sur les 8 élèves que j\'ai aidés tout au long de l\'année pour préparer le Bac de maths, deux ont obtenu 20/20, un a obtenu 18/20, un autre 17/20, deux ont obtenu 16/20 ainsi que deux autres respectivement 15/20 et 14/20, soit une moyenne de 17/20.\r\n\r\nUn élève ayant obtenu 15/20 au Bac n\'avait jamais eu la moyenne en Première ni en Terminale.\r\n\r\nJe suis professeur particulier de mathématiques et coach scolaire depuis ma sortie de l\'ESSEC en 2006. J\'ai fait ce choix par désir d’indépendance et goût pour l\'enseignement.\r\n\r\nExerçant cette activité à temps plein, il ne m\'est pas possible de me déplacer chez mes élèves. Les cours ont donc lieu à mon domicile, entre les métro Odéon, Luxembourg et Cluny la Sorbonne.\r\n\r\nLors de notre premier cours, nous prendrons le prétexte de l\'actualité de l\'élève (DST, exercices, DM à rendre) pour faire un vrai premier cours et ainsi évaluer son niveau et ses besoins. Chaque élève est différent. Je m’adapte le plus possible à la psychologie de chacun. Au terme de ce premier cours, nous nous mettrons d\'accord sur un créneau horaire d\'1h30 (à 10h30, 13h, 14h45, 16h30 ou 18h15 du lundi au vendredi, ainsi que le dimanche à partir de 13h) afin que l\'élève puisse compter sur la régularité qui sera la clé de son succès. Je m\'engage alors à assurer ce cours toutes les semaines en période scolaire et ce, jusqu\'à ce que l\'élève n\'ait plus besoin de moi. En fonction des urgences, des cours supplémentaires pourront être ajoutés selon mes disponibilités et, en particulier, durant les vacances des stages individuels, intensifs de révision pourront être','Bonjour,\r\n\r\nEn 2013, sur les 8 élèves que j\'ai aidés tout au long de l\'année pour préparer le Bac de maths, deux ont obtenu 20/20, un a obtenu 18/20, un autre 17/20, deux ont obtenu 16/20 ainsi que deux autres respectivement 15/20 et 14/20, soit une moyenne de 17/20.\r\n\r\nUn élève ayant obtenu 15/20 au Bac n\'avait jamais eu la moyenne en Première ni en Terminale.\r\n\r\nJe suis professeur particulier de mathématiques et coach scolaire depuis ma sortie de l\'ESSEC en 2006. J\'ai fait ce choix par désir d’indépendance et goût pour l\'enseignement.\r\n\r\nExerçant cette activité à temps plein, il ne m\'est pas possible de me déplacer chez mes élèves. Les cours ont donc lieu à mon domicile, entre les métro Odéon, Luxembourg et Cluny la Sorbonne.\r\n\r\nLors de notre premier cours, nous prendrons le prétexte de l\'actualité de l\'élève (DST, exercices, DM à rendre) pour faire un vrai premier cours et ainsi évaluer son niveau et ses besoins. Chaque élève est différent. Je m’adapte le plus possible à la psychologie de chacun. Au terme de ce premier cours, nous nous mettrons d\'accord sur un créneau horaire d\'1h30 (à 10h30, 13h, 14h45, 16h30 ou 18h15 du lundi au vendredi, ainsi que le dimanche à partir d