ant les vacances des stages individuels, intensifs de révision pourront être',300,NULL,NULL,'','1500','','3000',NULL,NULL,'','','50.6488575','3.0772127000000182',1000,'59110','La Madeleine','FR','155 Avenue de la République',NULL,NULL,'on',NULL,NULL,NULL,NULL,'2016-01-02 20:56:13','2016-01-02 20:57:26',NULL),(52,1,'','Cours et soutien en Français et Lettres modernes par professeur agrégé de Maths','','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2016-01-02 21:03:36','2016-01-02 21:11:32',NULL);
